import React from 'react';
import {Text, StyleSheet} from "react-native";

function Footer(props) {
    return (
        <div>
            
            <Text>Kelly Chibuye Logistics</Text>
        </div>
    );
}

export default Footer;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: '',
      justifyContent: '',
    },
    Img:{
        height:'40px',
        width:'40px',
        backgroundColor:"black"
    }
  });
